"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Heart attack recovery (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/heart-attack-recovery-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29400745\">",
"      <span class=\"h1\">",
"       What happens after a heart attack?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After a heart attack, also called a myocardial infarction or MI, your doctor will make a treatment plan with you. The goal of this plan is to prevent another heart attack and lower your chance of dying from heart disease.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400752\">",
"      <span class=\"h1\">",
"       Do I need to take medicines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Most people need to take more than 1 heart medicine every day. Doctors can prescribe different types of heart medicines. The ones you take will depend on your heart condition and how your heart attack was treated. Some heart medicines help prevent chest pain and other heart symptoms. Other heart medicines help prevent future heart attacks and help you live longer. To prevent another heart attack, you will probably need to take",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      and possibly another medicine every day.",
"     </p>",
"     <p>",
"      If you have high blood pressure, high cholesterol, or diabetes (high blood sugar), your doctor will likely prescribe medicines to treat those conditions. Having untreated high blood pressure, high cholesterol, or diabetes can increase your chance of having another heart attack.",
"     </p>",
"     <p>",
"      It&rsquo;s important to take your medicines exactly the way your doctor says. Let your doctor or nurse know if you have any side effects or problems with the medicines. You should also let him or her know if you can&rsquo;t afford your medicines. There are often ways to solve these problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400759\">",
"      <span class=\"h1\">",
"       Do I need to make lifestyle changes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You might. After a heart attack, your doctor or nurse will talk with you about:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Quitting smoking, if you smoke &mdash; Quitting smoking can lower your chance of getting or dying from heart disease. To stop smoking, some people find it helpful to:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Use nicotine patches, gum, or nasal sprays instead of cigarettes &mdash; Nicotine is the main drug found in cigarettes.",
"       </li>",
"       <li>",
"        Work with a counselor to find ways to make it easier to quit",
"       </li>",
"       <li>",
"        Take a prescription medicine to reduce cigarette cravings",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Getting exercise &mdash; Getting regular exercise can keep your heart healthy. Your doctor or nurse will suggest an exercise program that is safe for you. Most doctors recommend that people exercise 30 to 60 minutes a day, 5 or more days of the week. In your exercise program, you should include 3 main types of exercise:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        &ldquo;Aerobic exercise&rdquo; to raise your heart rate &mdash; Examples of aerobic exercise include walking, swimming, and jogging.",
"       </li>",
"       <li>",
"        &ldquo;Resistance training&rdquo; to make your muscles stronger &mdash; People can use weights or exercise bands to do these exercises.",
"       </li>",
"       <li>",
"        Stretching your muscles and joints",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Improving your diet &mdash; Eating the right foods can help keep you healthy. Fruits, vegetables, and foods with fiber can help prevent heart disease and strokes (",
"        <a class=\"graphic graphic_figure graphicRef79063 \" href=\"mobipreview.htm?41/38/42598\">",
"         figure 1",
"        </a>",
"        ). Try to avoid eating foods that can make heart disease worse. These include &ldquo;trans&rdquo; fats, which are found in many fast foods. &ldquo;Saturated&rdquo; fats, which are found in red meats and many cheeses, can also worsen heart disease. If you are overweight, it&rsquo;s important to lose weight. Losing extra weight lowers your chance of having another heart attack.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400766\">",
"      <span class=\"h1\">",
"       What is cardiac rehab?",
"      </span>",
"      &nbsp;&mdash;&nbsp;&ldquo;Cardiac rehab&rdquo; is the term doctors use for the care people receive after a heart attack. In your cardiac rehab program, doctors, nurses, and other health professionals will teach you how to keep your heart healthy. This includes ways to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Exercise safely",
"       </li>",
"       <li>",
"        Improve your diet, stop smoking, and control your other health conditions",
"       </li>",
"       <li>",
"        Cope with feeling sad or worried after your heart attack",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400773\">",
"      <span class=\"h1\">",
"       When can I have sex again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Having sex during the first 2 weeks after a heart attack could lead to more heart trouble. Check with your doctor about when it is safe to start having sex again. The timing will depend on the size of your heart attack, if you had problems after your heart attack, and if you still have symptoms.",
"     </p>",
"     <p>",
"      After a heart attack, some people are less interested in sex or do not enjoy sex as much. This can be caused by certain heart medicines. It can also happen if people are worried about having a heart attack during sex. If you have problems with sex, let your doctor or nurse know. He or she might be able to treat those problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400780\">",
"      <span class=\"h1\">",
"       When can I drive again and return to work?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Check with your doctor about when it is safe for you to drive again and return to work. Most people can drive again 1 week after their heart attack. Many people can return to work within 2 weeks of having a heart attack.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29400787\">",
"      <span class=\"h1\">",
"       What symptoms should I watch for?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After you have a heart attack, you should watch for chest pain or symptoms of another heart attack (",
"      <a class=\"graphic graphic_figure graphicRef52579 \" href=\"mobipreview.htm?1/15/1268\">",
"       figure 2",
"      </a>",
"      ). People who have a heart attack have a higher than normal chance of having another heart attack and other heart problems.",
"     </p>",
"     <p>",
"      If you think you might be having another heart attack,",
"      <strong>",
"       call 9-1-1 right away",
"      </strong>",
"      . Do not try to get to the hospital on your own.",
"     </p>",
