"      Patient information: Medicines after a heart attack (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?19/13/19670?source=related_link\">",
"      Patient information: Quitting smoking (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?17/46/18146?source=related_link\">",
"      Patient information: Quitting smoking (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?6/21/6483?source=related_link\">",
"      Patient information: Reducing the costs of medicines (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
