var title_f37_6_37996="Main bone morphogenic";
var content_f37_6_37996=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75006&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75006&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Main bone morphogenic proteins and noncollagenous bone matrix proteins and genes involved in vascular calcification in animals and humans",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Protein",
"       </td>",
"       <td class=\"subtitle1\">",
"        Function",
"       </td>",
"       <td class=\"subtitle1\">",
"        Vascular calcification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Osteopontin",
"       </td>",
"       <td>",
"        Antiapoptotic signal for osteoclasts; chemotactic factor for MC and MP",
"       </td>",
"       <td>",
"        Recruitment of MP into area of vessel injury; osteopontin knockout mice develop stronger skeleton; osteopontin restrains mineralization",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Osteoprotegerin/RANKL",
"       </td>",
"       <td>",
"        Inhibitor of osteoclastogenesis; member of tumor necrosis factor-&alpha; receptor superfamily",
"       </td>",
"       <td>",
"        OPG inhibited by cyclosporine A; OPG inhibited by osteopontin; restrains mineralization",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Matrix GLA protein",
"       </td>",
"       <td>",
"        Expressed in chondrocytes and vascular smooth muscle cells and increased expression in lipid-rich plaque",
"       </td>",
"       <td>",
"        Knockout mice get dramatic early vascular calcification; warfarin effect on gamma-carboxylation (as osteocalcin); potent inhibitor of mineralization; inhibits bone morphogenic protein-2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Parathyroid hormone (PTH) recombinant protein",
"       </td>",
"       <td>",
"        Paracrine factor with potential humoral activity in hypercalcemia of malignancy; shares PTH1 receptor with PTH; involved with normal bone physiology",
"       </td>",
"       <td>",
"        Upregulated expression by vessel injury and angiotensin II; antagonizes procalcifying effect of vitamin D3; down-regulates bone morphogenic protein-2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone morphogenic protein-2",
"       </td>",
"       <td>",
"        Osteoblastic and mesenchymal differentiation",
"       </td>",
"       <td>",
"        Promotes ossification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone morphogenic protein-7",
"       </td>",
"       <td>",
"        Differentiation factor; normal tubular epithelial differentiation; osteoblastic differentiation",
"       </td>",
"       <td>",
"        Null mouse has renal failure and agenesis; reverses heterotopic calcification in animal models",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin D",
"       </td>",
"       <td>",
"        Diverse functions through vitamin D receptor-dependent and independent pathways",
"       </td>",
"       <td>",
"        Medial calcification; vascular smooth muscle cells have vitamin D receptors; raised calcium-phosphate product",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetuin",
"       </td>",
"       <td>",
"        Synthesized in liver; soluble transforming growth factor-&beta; antagonist; negative acute phase reactant",
"       </td>",
"       <td>",
"        Knockout mice get ubiquitous soft tissue and vascular calcification; potent inhibitor of mineralization",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pyrophosphate",
"       </td>",
"       <td>",
"        Naturally occurring inhibitor of calcification",
"       </td>",
"       <td>",
"        Loss-of-function mutations that result in decreased pyrophosphate cause idiopathic infantile arterial calcification",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MC: monocyte; MP: macrophage; OPG: osteoprotegerin; RANKL: receptor activator of NF kappaB ligand.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Goldsmith D, Ritz E, Cvic A. Vascular calcification: a stiff challenge for the nephrologist: does preventing bone disease cause arterial disease? Kidney Int 2004; 66:1315. Copyright &copy; 2004 Blackwell Publishing.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
